Peleón en Guadalajara.
@canelo tiró dos veces a @_john_ryder_, que desde la segunda vuelta peleó cortado. 
El mexicano tiro todos los golpes. Su derecha hizo tambalear al británico varías veces. Pero de guapo, siguió poniendo la cara. 
@canelo buscó el nocaut en cada minuto de la pelea. Incluso cuando  se sabía que ganaba en las tarjetas, seguía buscando. 
El mexicano ganó 11 de los 12 rounds. Perdió sólo el último. Y así fueron las tarjetas. Se quedó con la pelea por decisión unánime. 
A @_john_ryder_ le queda el orgullo de haber terminado de pie. Y haber combatido como un gladiador. Con la cara llena de machucones, nunca arrugó. Y siempre fue a buscar.

Boca terminó con Merentiel, Valentini, Equi Fernández y Almiron expulsados. Además Pol y Varela llegaron a la 5ta amarilla. Y no estarán con Belgrano. 
Por otra parte, la fiscal le labró un acta a Rojo. Y pidió planilla del partido. Quieren citar a los que no estaban convocados y participaron de la pelea.
